import React, { Component } from 'react';
import './slideImagens.css';
import Slider from "react-slick";
import Teste from "../../images/teste.jpeg"
import Test2 from "../../images/test2.png"


export default class SlideImagens extends Component {
  render() {
    const settings = {
      dots: true,
      infinite: true,
      speed: 500,
      slidesToShow: 3,
      slidesToScroll: 1
    };
    return (
      <div className="container-slider">
        <div className="slider-imagens">
          <Slider {...settings}>
              <img src={Teste} />
              <img src={Test2} />
              <img src={Teste} />
              <img src={Test2} />
              <img src={Teste} />
              <img src={Test2} />
          </Slider>
        </div>
      </div>
    );
  }
}
